import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./components/Home";
import Footer from "./components/Footer";

import { useState, useEffect, } from 'react';
import axios from "axios";

import AppNavBar from "./menu/AppNavBar";
 import KitchenSink from './examples/KitchenSink';
import UploadTadaAdvance from './components/UploadTadaAdvance';
import PayElementList from './components/PayElementList';
import CbillTadaLtcList from './components/CbillTadaLtcList';
import CbillTadaLtcEdit from './components/CbillTadaLtcEdit';
import EmployeeList from './components/EmployeeList';
import EmployeeEdit from './components/EmployeeEdit';
import PayElementEdit from './components/PayElementEdit';
import GrievanceList from './components/GrievanceList';
import GrievanceEdit from './components/GrievanceEdit';
import CommissionControlList from './components/CommissionControlList';
import CommissionControlEdit from './components/CommissionControlEdit';
import CbillTadaLtcPendingList from './components/CbillTadaLtcPendingList';

import NdcList from './components/NdcList';
import NdcApprovedList from './components/NdcApprovedList';
import IrlaDebitCsv from './components/IrlaDebitCsv';
import NdcEdit from './components/NdcEdit';
import Maintenance from './components/Maintenance';

import CmpRejectionList from './components/CmpRejectionList';
import CbillTadaLtcInputList from './components/CbillTadaLtcInputList';

import DemandRegisterManualList from './components/DemandRegisterManualList';
import DemandRegisterManualEdit from './components/DemandRegisterManualEdit';

import PmUploadControlList from './components/PmUploadControlList';
import PmUploadControlEdit from './components/PmUploadControlEdit';
import PrintPmCs from './components/PrintPmCs';
import Rollback from './components/Rollback';
import SectionList from './components/SectionList';
import UsrSectionList from './components/UsrSectionList';
import SectionEdit from './components/SectionEdit';
import UsrSectionEdit from './components/UsrSectionEdit';
import RolList from './components/RolList';
import RolEdit from './components/RolEdit';
import UnitList from './components/UnitList';
import UnitEdit from './components/UnitEdit';
import CorpsList from './components/CorpsList';
import CorpsEdit from './components/CorpsEdit';
import UsrList from './components/UsrList';
import UsrListSelf from './components/UsrListSelf';
import UsrEdit from './components/UsrEdit';
import PasswordEdit from './components/PasswordEdit';
import UsrRolList from './components/UsrRolList';
import AllowanceRateList from './components/AllowanceRateList';
import DakEdit from './components/DakEdit';
import DakList from './components/DakList';
import DakProcessedList from './components/DakProcessedList';
import DakTopList from './components/DakTopList';
import DakTypeEdit from './components/DakTypeEdit';
import DakTypeList from './components/DakTypeList';
import PayCodeEdit from './components/PayCodeEdit';
import PayCodeList from './components/PayCodeList';
import RankEdit from './components/RankEdit';
import RankList from './components/RankList';
import BankEdit from './components/BankEdit';
import BankList from './components/BankList';
import MenuList from './components/MenuList';
import MenuEdit from './components/MenuEdit';

import CmpRejection from './components/CmpRejection';

import BankAccountEdit from './components/BankAccountEdit';
import BankAccountList from './components/BankAccountList';
import BillTypeEdit from './components/BillTypeEdit';
import BillTypeList from './components/BillTypeList';
import CommissionGoiEdit from './components/CommissionGoiEdit';
import CommissionGoiList from './components/CommissionGoiList';
import CommissionFormaEdit from './components/CommissionFormaEdit';
import CommissionFormaList from './components/CommissionFormaList';
import DpSheetList from './components/DpSheetList';
import CmpGeneration from './components/CmpGeneration';
import CmpSummary from './components/CmpSummary';
import FileList from './components/FileList';
import TaskList from './components/TaskList';
import TaskEdit from './components/TaskEdit';
import TestoscmList from './components/TestoscmList';
import TestoscmEdit from './components/TestoscmEdit';

import FamilyDetailList from './components/FamilyDetailList';
import FamilyDetailEdit from './components/FamilyDetailEdit';
import DemandRegisterList from './components/DemandRegisterList';
import CbillFundList from './components/CbillFundList';
import CbillFundEdit from './components/CbillFundEdit';
import OmroList from './components/OmroList';
import OmroEdit from './components/OmroEdit';
import DisallowanceCodeList from './components/DisallowanceCodeList';
import DisallowanceCodeEdit from './components/DisallowanceCodeEdit';

import TBillInfoEdit from './components/TBillInfoEdit';
import AdrReviewList from './components/AdrReviewList';
import AdrReviewEdit from './components/AdrReviewEdit';
import UploadEtkt from './components/UploadEtkt';
import UploadAirData from './components/UploadAirData';
import KonkanRailwayCarriageBill from './components/KonkanRailwayCarriageBill';
import CbillLoanList from './components/CbillLoanList';
import CbillLoanEdit from './components/CbillLoanEdit';
import CbillLegacyClaimList from './components/CbillLegacyClaimList';

import Schedule3List from './components/Schedule3List';
import PrintTopList from './components/PrintTopList';
import TaskWisePendency from './components/TaskWisePendency';
 import CbillTadaLtcApprovedList from './components/CbillTadaLtcApprovedList';
 import RejectionDetailList from './components/RejectionDetailList';
import RejectionDetailEdit from './components/RejectionDetailEdit'; 

 import PrintRequisition from './components/PrintRequisition';
 import OmroApprovedList from './components/OmroApprovedList';
import ViewPm from './components/ViewPm';


const App = () => {

	const [serverErrors, setServerErrors] = useState([]);
	const [menu, setMenu] = useState();
	const [usrName,setUsrName]=useState('NA');

	useEffect(() => {
		console.log('From App');
		let fetching = false;
		async function fetchData() {
			if (!fetching)
				await axios.get('/menus?filter=usr')
					.then((response) => {
						//console.log(typeof response.data);
						if (typeof response.data!=='string') {//json menu data is an object
							//setData(response.data);
							setMenu(response.data);
							//console.log(menu);
						}


					})
					.catch((error) => {
						//console.log(error);
						//console.log(error.response.status);
						//console.log(error.response.headers);
						if (error.response)
							setServerErrors(error.response.data.error);
						else
							setServerErrors(error.Error);
					})
		}
		fetchData();
		//console.log(menu);
		return () => { fetching = true; }

	}, []);

	return (

		<Router basename={process.env.REACT_APP_ROUTER_BASE || ''}>
			<AppNavBar menu={menu}  />
			<Switch>
				<Route path="/" exact={true} component={Home} />				
				<Route path="/kitchen" component = {KitchenSink} />
				<Route path="/files" component = {FileList} />
				<Route path="/payments/paymentSummary" exact={true}  component = {CmpSummary} />
				<Route path="/schedule3s/cmpGen" exact={true}  component = {CmpGeneration} />
				<Route path="/chequeSlips/dpsList" exact={true}  component = {DpSheetList} />
				<Route path="/cbillTadaLtcInputs/upload/advances" exact={true}  component = {UploadTadaAdvance} />
				<Route path="/pms" exact={true} component = {PrintPmCs} />	
				<Route path="/pms/0/rollbackLoad" exact={true} component = {Rollback} />						
				<Route path="/payElements" exact = {true} component = {PayElementList} />
				<Route path="/ndcs" exact = {true} component = {NdcList} />
				<Route path="/ndcs/approvedList" exact = {true} component = {NdcApprovedList} />
				<Route path="/cbillTadaLtcs/allBills/pendingForSection" exact = {true} component = {CbillTadaLtcPendingList} />
				<Route path="/ndcs/csv/irlaDebit" exact = {true} component = {IrlaDebitCsv} />
				<Route path="/ndcs/:id"  component = {NdcEdit} />
				<Route path="/omros/approvedList" exact = {true} component = {OmroApprovedList} />
 <Route path="/omros/:id/viewPm"  exact={true} component = {ViewPm} />


				<Route path="/cbilltadaltcs/:id"  exact={true} component = {CbillTadaLtcEdit} />	
				 <Route path="/cbilltadaltcs/:id/tbillInfo"  exact={true} component = {TBillInfoEdit} /> 
				 <Route path="/cbilltadaltcs/:id/konkanRailwayCarriageBill"  exact={true} component = {KonkanRailwayCarriageBill} />
				 <Route path="/cbilltadaltcs" exact = {true} component = {CbillTadaLtcList} />
				 <Route path="/cbillTadaLtcs/twControls/pendency" exact = {true} component = {TaskWisePendency} />
				  <Route path="/cbillTadaLtcs/allBills/approved" exact = {true} component = {CbillTadaLtcApprovedList} />

				  <Route path="/demandRegisters/newDemand/showManual" exact = {true} component = {DemandRegisterManualList} />
				<Route path="/demandRegisters/manualDemand/:id"  component = {DemandRegisterManualEdit} />	

				 		<Route path="/pmUploadControls" exact = {true} component = {PmUploadControlList} />
				 		<Route path="/pmUploadControls/new" exact = {true} component = {PmUploadControlEdit} />
				 		<Route path="/payments/rejection/:id" exact = {true} component = {CmpRejection} />
				 		<Route path="/payments/rejections/viewPending" exact = {true} component = {CmpRejectionList} />


					<Route path="/cbillTadaLtcInputs/advReq/1" exact = {true} component = {PrintRequisition} />
				<Route path="/employees" exact = {true} component = {EmployeeList} />
				<Route path="/employees/:id"  component = {EmployeeEdit} />	
				<Route path="/payElements/:id"  component = {PayElementEdit} />					
				<Route path="/grievances" exact = {true} component = {GrievanceList} />
				<Route path="/grievances/:id"  component = {GrievanceEdit} />
				<Route path="/rols" exact = {true} component = {RolList} />
				<Route path="/rols/:id"  component = {RolEdit} />
				<Route path="/sections" exact = {true} component = {SectionList} />
				<Route path="/sections/:id"  component = {SectionEdit} />
				<Route path="/usrs/:id/rols"  exact={true} component = {UsrRolList} />
				<Route path="/usrs/self/acct"  exact={true} component = {UsrListSelf} />
				<Route path="/units/:id" exact={true} component={UnitEdit} />		
				<Route path="/units" exact={true} component={UnitList} />
				<Route path="/corpss/:id" exact={true} component={CorpsEdit} />		
				<Route path="/corpss" exact={true} component={CorpsList} />
				<Route path="/usrs/:id" exact={true} component={UsrEdit} />	
				<Route path="/usrs/:id/password" exact={true} component={PasswordEdit} />		
				<Route path="/usrs" exact={true} component={UsrList} />
				<Route path="/commissionControls" exact={true} component={CommissionControlList} />
				<Route path="/commissionControls/:id" exact={true} component={CommissionControlEdit} />
				<Route path="/allowanceRates" exact = {true} component = {AllowanceRateList} />
				<Route path="/demandRegisters" exact = {true} component = {DemandRegisterList} />
				<Route path="/daks/dakLists" exact = {true} component = {DakTopList} />
				<Route path="/daks/printTopList" exact = {true} component = {PrintTopList} />
				<Route path="/daks" exact = {true} component = {DakList} />
				<Route path="/daks/view/allDaks" exact = {true} component = {DakProcessedList} />
				<Route path="/daks/:id"  component = {DakEdit} />
				<Route path="/maintenance"  component = {Maintenance} />

				<Route path="/menus" exact = {true} component = {MenuList} />
				<Route path="/menus/:id"   component = {MenuEdit} />
					<Route path="/tasks" exact = {true} component = {TaskList} />
					<Route path="/tasks/:id"   component = {TaskEdit} />

					<Route path="/disallowanceCodes" exact = {true} component = {DisallowanceCodeList} />
					<Route path="/disallowanceCodes/:id"   component = {DisallowanceCodeEdit} />

				 <Route path="/testoscms" exact = {true} component = {TestoscmList} />
					<Route path="/testoscms/:id"   component = {TestoscmEdit} />
				 <Route path="/familyDetails/:id"  component={FamilyDetailEdit} />		
				<Route path="/familyDetails" exact={true} component={FamilyDetailList} />

				<Route path="/dakTypes" exact = {true} component = {DakTypeList} />
				<Route path="/dakTypes/:id"  component = {DakTypeEdit} />
				<Route path="/payCodes" exact = {true} component = {PayCodeList} />
				<Route path="/payCodes/:id"  component = {PayCodeEdit} />
				<Route path="/ranks" exact = {true} component = {RankList} />
				<Route path="/ranks/:id"  component = {RankEdit} />
				<Route path="/billTypes" exact = {true} component = {BillTypeList} />
				<Route path="/billTypes/:id"  component = {BillTypeEdit} />

				<Route path="/banks" exact = {true} component = {BankList} />
				<Route path="/banks/:id"  component = {BankEdit} />
				<Route path="/bankAccounts" exact = {true} component = {BankAccountList} />
				<Route path="/bankAccounts/:id"  component = {BankAccountEdit} />

				<Route path="/commissionGois" exact = {true} component = {CommissionGoiList} />
				<Route path="/commissionGois/:id"  component = {CommissionGoiEdit} />

				<Route path="/commissionFormas" exact = {true} component = {CommissionFormaList} />
				<Route path="/commissionFormas/:id"  component = {CommissionFormaEdit} />
				<Route path="/usrSections" exact = {true} component = {UsrSectionList} />
				<Route path="/usrSections/:id"   component = {UsrSectionEdit} />

				<Route path="/cbillfunds" exact = {true} component = {CbillFundList} />
				<Route path="/cbillfunds/:id"  component = {CbillFundEdit} />	

				<Route path="/omros" exact = {true} component = {OmroList} />
				<Route path="/omros/:id"  component = {OmroEdit} />	
				<Route path="/cbilltadaltcinputs" exact = {true} component = {CbillTadaLtcInputList} />	
				<Route path="/adrReviews" exact={true} component={AdrReviewList} />

				 <Route path="/demandRegisters/:id"  component={AdrReviewEdit} />		

				<Route path="/dtsRailTransactions/upload/etkt" exact={true}  component = {UploadEtkt} />
				<Route path="/dtsTransactions/upload/airData" exact={true}  component = {UploadAirData} />	

				<Route path="/cbillloans" exact = {true} component = {CbillLoanList} />
				<Route path="/cbillloans/:id"  component = {CbillLoanEdit} />	

				<Route path="/cbillLegacyClaims" exact = {true} component = {CbillLegacyClaimList} />
				<Route path="/schedule3s" exact = {true} component = {Schedule3List} />
				<Route path="/rejectionDetails" exact = {true} component = {RejectionDetailList} />
				<Route path="/rejectionDetails/:id"  component = {RejectionDetailEdit} />
			</Switch>

			<div>
				<br />
				<br />
				<br />
				<Footer />
			</div>
		</Router>
	);
};
export default App;
